// src/pages/reviewPage/reviewPage.js
import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';

import MyPageHeader from '../myPage/myPage_header';
import MyPageCategory from '../myPage/myPage_category';
import MyPageMenu from '../myPage/myPage_menu';
import ReviewPageReview from './reviewPage_review';

function ReviewPage() {
  return (
    <div>
      {/* 공통 헤더/카테고리/메뉴 */}
      <MyPageHeader />
      <MyPageCategory />
      <MyPageMenu />

      {/* 본문 시작 */}
      <div className="review-content">
        <h1>리뷰 페이지</h1>
        <nav>
          <Link to="review">후기 모아보기</Link>
        </nav>

        <Routes>
          <Route path="review" element={<ReviewPageReview />} />
        </Routes>
      </div>
    </div>
  );
}

export default ReviewPage;
